export const WORKFLOW_URL = 'https://cookiescout2.bubbleapps.io/version-test/api/1.1/wf';
export const DATA_URL = 'https://cookiescout2.bubbleapps.io/version-test/api/1.1/obj';

export const TBA_KEY = 'QMX6lOKtgvG1vLLPDSt2yvsPCVNV77FOFXreWkcMX3WXv0CSPH8EiBeuD3gjWAvL';
export const TBA_URL = 'https://www.thebluealliance.com/api/v3';

export const LOCALKEYS = {
    APPVAR: 'appVariables',
    COLORDICT: 'colorDict',
    EVENTMATCHES: 'eventMatches',
    USERINFO: 'userInfo',
};

export const PHASES = {
    pregame: {
        forward: PHASES.auto,
        forwardLabel: 'Auto',
        back: null,
        backLabel: 'Cancel',
        display: 'Pregame',
        endTime: null,
    },
    auto: {
        forward: PHASES.teleop,
        forwardLabel: 'Teleop',
        back: PHASES.pregame,
        backLabel: 'Pregame',
        display: 'Auto',
        endTime: 135,
    },
    teleop: {
        forward: PHASES.endgame,
        forwardLabel: 'Endgame',
        back: PHASES.auto,
        backLabel: 'Auto',
        display: 'Teleop',
        endTime: 30,
    },
    endgame: {
        forward: PHASES.submit,
        forwardLabel: 'Submit',
        back: PHASES.teleop,
        backLabel: 'Teleop',
        display: 'Endgame',
        endTime: -20,
    },
    submit: {
        forward: null,
        forwardLabel: null,
        back: null,
        backLabel: null,
        display: 'Submit',
        endTime: -80,
    },
}
